// === Voice Agent JSON Sanitiser ===
let raw = $json.output || $json.data || $input.item.json.text || "";
raw = raw.trim()
  .replace(/^```json/i, "")
  .replace(/^```/, "")
  .replace(/```$/, "")
  .replace(/[\u0000-\u001F]+/g, " ")
  .trim();
const firstBrace = raw.indexOf("{");
const lastBrace = raw.lastIndexOf("}");
if (firstBrace > -1 && lastBrace > firstBrace) raw = raw.slice(firstBrace, lastBrace + 1);
let parsed;
try { parsed = JSON.parse(raw); } catch (err) {
  let repaired = raw.replace(/\n+/g, " ").replace(/\r+/g, " ")
    .replace(/\\(?!["\\/bfnrtu])/g, "\\\\")
    .replace(/‚Äú|‚Äù/g, '"').replace(/‚Äò|‚Äô/g, "'");
  try { parsed = JSON.parse(repaired); } catch { return [{ json: { status: "error", message: "Invalid or unrepairable JSON", raw_response: raw } }]; }
}
if (!parsed || typeof parsed !== "object") return [{ json: { status: "error", message: "Output not an object", raw_response: raw } }];
if (!parsed.agent_prompt || typeof parsed.agent_prompt !== "string") { parsed.status = "error"; parsed.message = "Missing or invalid agent_prompt"; }
if (parsed.agent_prompt) parsed.agent_prompt = parsed.agent_prompt.replace(/\s+/g, " ").replace(/\\n/g, " ").replace(/[\"]+/g, '"').trim();
return [{ json: { status: parsed.status || "success", agent_prompt: parsed.agent_prompt || "", validated: true } }];

